/* Generated File Run.js in Project osjdevtools */	function close_osjdevtools(){	Minimizer.close("osjdevtools");}	function minimize_osjdevtools(){	Minimizer.minimize("osjdevtools");}	function maximize_osjdevtools(){	Minimizer.maximize("osjdevtools");}function open_osjdevtools(){}/* Initialize application */			function init_osjdevtools(){	$("#body-osjdevtools").keypress(function(event) {	}).mouseover(function(){		/* Make application draggable */        $("#osjdevtools-container").draggable({disabled:true});        document.getSelection().removeAllRanges();    }).mouseout(function(){        $("#osjdevtools-container").draggable({disabled:false});    });		$("#osjdevtools-container").mousedown(function(){		Focus.set("osjdevtools");		setMenu_osjdevtools();			fixSizeosjdevtoolsSpeed = 0;	})	.mouseup(function(){		fixSizeosjdevtoolsSpeed = 500;	});		/* Make application resizable */	Resizable.set("osjdevtools");		$("#exit-osjdevtools").mousedown(function(){		close_osjdevtools();		$("#body-osjdevtools").val("");	});	$("#maximize-osjdevtools").mousedown(function(){		maximize_osjdevtools()	});		$("#minimize-osjdevtools").mousedown(function(){		minimize_osjdevtools()	});			fixSize_osjdevtools();}/* Fix size application */var fixSizeosjdevtoolsSpeed = 500;function fixSize_osjdevtools(){	setTimeout(function(){		if(LoadAppsID["osjdevtools"].state == "opened"){			height = $("#osjdevtools-container").height();			width = $("#osjdevtools-container").width();			$("#body-osjdevtools").css({"height" : height-45, "width" : width-5});		}		fixSize_osjdevtools();	},fixSizeosjdevtoolsSpeed);}/* Set application menu */function setMenu_osjdevtools(){	proIdApps = "osjdevtools";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>osjDevTools</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_osjdevtools(proIdApps)>Minimize</li>"+			"<li onclick=maximize_osjdevtools(proIdApps)>Maximize</li>"+			"<li onclick=close_osjdevtools(proIdApps)>Quit osjDevTools</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_osjdevtools(){	$.post("system/applications/osjdevtools/layout/osjdevtools.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_osjdevtools,100);		fixSize_osjdevtools();		applicationOpened++;	});	}/* Running application */function run_osjdevtools(dir, fileName){}